import React from 'react';
import { useSelector, useDispatch } from 'react-redux';




const Transactions = () => {


	const transactions = useSelector( (state) => state.transactions);


	return (
		<div className="transactions">
			<span className="transactions--title">transaction history</span>
			<div className="transactions--wrapper">
				{transactions.length == 0 
				? (<span class="transactions--wrapper--message">no history to show yet</span>)
				: (
					transactions.map((t) => {
						<div className="transactions--item" key={t.id}>
							<span className="ransactions--item--image"><i></i></span>
						</div>
					})
				)}
			</div>
		</div>
	)
}

export default Transactions;
